INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID13', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I pay my loan dues from the mobile and online banking apps?', 'Yes, you can pay your loan due amount from the online banking application. You can view your due amount and make partial or full payment of the amount due.', 'SID_ACTIVE', 'FAQ_CAT_ID4', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
