INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID15', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'Can I set up recurring or future dated transfer?', 'Yes. You can schedule future-dated transfers. Recurring transfers can be made at regular intervals, such as daily, weekly, every 2 weeks, monthly, etc.', 'SID_ACTIVE', 'FAQ_CAT_ID4', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID16', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I cancel a scheduled transfer?', 'Yes, you can cancel a scheduled transfer. It will cancel and stop all the pending transfers in case of recurring transactions', 'SID_ACTIVE', 'FAQ_CAT_ID4', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID17', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'How can I communicate with the bank from the mobile and online banking applications?', 'You can send messages to the bank in a secure method from the mobile and online banking applications', 'SID_ACTIVE', 'FAQ_CAT_ID9', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID18', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'Can I send attachments with my messages to the bank from the app?', 'Yes, you can send up to 5 attachments per message. Each attachment can have a maximum size of 1 MB. ', 'SID_ACTIVE', 'FAQ_CAT_ID9', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
