INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID22', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Is there a limit to the number of bills I can pay online?', 'No. There is no limit in the number of bills you can pay online', 'SID_ACTIVE', 'FAQ_CAT_ID5', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID23', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'How can I stop a scheduled payment?', 'Yes, you can cancel a scheduled payment. Go to scheduled payments list in bill pay and find the cancel option to stop a payment', 'SID_ACTIVE', 'FAQ_CAT_ID5', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
