INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID27', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'How does send work in pay a person?', 'To send money to someone, enter their name, e-mail address or mobile phone number, the amount you want to send, and a transaction note. Follow the instructions to complete the payment/transfer. The funds will automatically be withdrawn from your account and sent electronically to their account.', 'SID_ACTIVE', 'FAQ_CAT_ID6', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID28', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'How does receive work in pay a person?', 'To request money from someone, enter their name, e-mail address or mobile phone number, the amount requested, and a personal message. Follow the instructions to complete the payment/transfer request.They will receive a notification and instructions on how to complete the payment.Once they confirm, the funds will automatically be debited from their account and credited to your account.', 'SID_ACTIVE', 'FAQ_CAT_ID6', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
