INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID30', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'Can I schedule a send / request for a payee?', 'Yes. You can schedule a send / request money transfer by choosing a future date for the transaction', 'SID_ACTIVE', 'FAQ_CAT_ID6', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID31', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I schedule a recurring send to a payee?', 'Yes. You can schedule a transaction, choose the frequency (Daily, Monthly, Weekly, etc) and specify the end date or duration to stop the recurrence.', 'SID_ACTIVE', 'FAQ_CAT_ID6', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID32', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'Where can I find my account statement?', 'Login into your mobile/online banking application. Select the required acccount and choose "Account Statements". Select the required period to get the account statement for that period', 'SID_ACTIVE', 'FAQ_CAT_ID10', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID33', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'Can I schedule an account statement to my email?', 'No, you can''t schedule an accout statement to your email', 'SID_ACTIVE', 'FAQ_CAT_ID10', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID34', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I download my account statement?', 'Yes. You have the options to download, print or send the statement to an email', 'SID_ACTIVE', 'FAQ_CAT_ID10', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID35', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'Can I get my account statement for any period?', 'Yes. Mention the start and end date to download statement for the required period', 'SID_ACTIVE', 'FAQ_CAT_ID10', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID36', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'What are the formats in which I can download the statement?', 'Excel, PDF and Quicken are the formats in which you can download your account statement. ', 'SID_ACTIVE', 'FAQ_CAT_ID10', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID37', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I request for a card from my mobile/online banking application?', 'Yes. You can place a request for a new card from your mobile / online banking application', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID38', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'What are different card management options available online', 'Following are the options availabe to manage your card online:
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID39', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'How can I change my debit/credit card PIN online?', 'Login into your mobile/online banking application. Go to "Manage Card" section, select the required card and select "Change Pin" option. Provide the reason for chaning the pin and confirm your request. You will receive a mail with new pin', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID4', 'CH_ID_MOB_INT', 'FAQ_732018174844', 'I forgot my username. How can I log into the app?', 'Click on Forgot and provide the information to identify yourself; Validate your identity with the Secure Access Code or Card CVV. If validated correctly, you will be able to retreive your username', 'SID_ACTIVE', 'FAQ_CAT_ID1', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID40', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'I have lost my card. How can I report it online?', 'Login into your mobile/online banking application. Go to "Manage Card" section, select the required card. Select Report stolen/lost option. You have options to either call customer care directly or to log a report online.', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID41', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'Can I withdraw my stolen/lost report online to reactivate my card?', 'No, you can''t withdraw stolen/lost report online.', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID42', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'If I lock my card can I unlock in again online?', 'Yes. You can unlock your locked card online with mobile/online banking application. The card can then be used to perform all transactions', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID43', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Can I use my debit/credit card to pay billsin online banking?', 'Yes. Login into your mobile/online banking and register with your card details to make bill payments', 'SID_ACTIVE', 'FAQ_CAT_ID3', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID44', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'Is it safe to bank and pay bills online?', 'When you register for online banking, you create a unique username and password.So you and only you can access your accounts. Kindly ensure that you do not write it down in any form or share it with anyone.You are responsible for protecting your password, account details and for providing prompt notification in case of an unauthorized transaction.', 'SID_ACTIVE', 'FAQ_CAT_ID7', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID45', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'How is online banking security measured?', 'Online Banking uses industry-standard security protocols that leverage encryption for transferring data. Encryption helps create a secure environment for the information being transferred between your browser and Bank of America.
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID46', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'How does the security protocols protect data?', 'These protocols protect data in 3 key ways:
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID47', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'Is it secure to do online/mobile banking outside my country?', 'Yes, you can do online/mobile banking from anywhere in the world with the same level of security', 'SID_ACTIVE', 'FAQ_CAT_ID7', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID48', 'CH_ID_MOB_INT', 'FAQ_732018175334', 'Is it safe to access online banking feature from multiple computers', 'Yes, you can access online banking feature from multiple computers with the same level of security. ', 'SID_ACTIVE', 'FAQ_CAT_ID7', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID49', 'CH_ID_MOB_INT', 'FAQ_732018175335', 'Is it safe to use mobile browser to do online banking?', 'Yes, it is safe to do online banking on mobile browser. However, it is recommended that you logout and close your browser after performing online banking', 'SID_ACTIVE', 'FAQ_CAT_ID7', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID5', 'CH_ID_MOB_INT', 'FAQ_732018175359', 'I forgot my password. How can I log into the app?', 'Click on Forgot and provide the information to identify yourself; Validate your identity with the Secure Access Code or Card CVV. If validated correctly, you will be able to reset your password', 'SID_ACTIVE', 'FAQ_CAT_ID1', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID50', 'CH_ID_MOB_INT', 'FAQ_732018175336', 'I share my computer with someone who also uses Online Banking. Can both of us sign in from this computer?', 'Yes. You can both use the same computer to sign in to your individual online banking account safely; you won''t see each other''s information. There''s no limit to how many people can sign in to online banking from the same computer. Just remember not to share your Username and Password.', 'SID_ACTIVE', 'FAQ_CAT_ID7', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID6', 'CH_ID_MOB_INT', 'FAQ_732018175359', 'Why do I see only some of my accounts on the dashboard?', 'Only accounts marked as Favorites are listed on the Dashboard screen. Favorite accounts are indicated with a filled in star next to the account name on the dashbaord list. Select the option "Show All Accounts" to view the remaining accounts. Click on the star next to an account to add it to Favorites or remove it from Favorites. ', 'SID_ACTIVE', 'FAQ_CAT_ID2', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID7', 'CH_ID_MOB_INT', 'FAQ_732018175512', 'Which account types are listed in the mobile/online banking applications?', 'The mobile and online banking apps support the following account types: Savings, Checking, Credit Cards, Loans, Deposits/Line of Credit', 'SID_ACTIVE', 'FAQ_CAT_ID2', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID8', 'CH_ID_MOB_INT', 'FAQ_732018174732', 'Can I update my name from the Mobile and Online banking apps?', 'No. You cannot update your name from the applications, but you can download the Name Change Request form from the online banking application that you can print and submit at the bank.', 'SID_ACTIVE', 'FAQ_CAT_ID8', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[faqs](id, Channel_id, QuestionCode, Question, Answer, Status_id, FaqCategory_Id, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('FAQ_ID9', 'CH_ID_MOB_INT', 'FAQ_73201817516', 'Can I update my username and password for the mobile and online banking apps?', 'Yes, you can use the Profile section to update the username or password as needed from the mobile and online banking apps', 'SID_ACTIVE', 'FAQ_CAT_ID8', 'UID11', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
