INSERT INTO [konyadminconsole].[policies](id, PolicyName, PolicyDescription, createdby, modifiedby, createdts, lastmodifiedts, lastsynctimestamp, softdeleteflag) VALUES ('POLID1', 'Username Policy for End Customers', '<ul><li>From 8 to 24 characters.</li>  <li>No spaces or special characters allowed except period ''.''</li>  <li>Can be alpha-numeric(a-z,A-Z,0-9).</li>  <li>Should Start with an alphabet or digit.</li>  <li>Username is not case-sensitive.</li>  <li>Period ''.'' cannot be used more than once.</li></ul>', 'Kony User', '', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[policies](id, PolicyName, PolicyDescription, createdby, modifiedby, createdts, lastmodifiedts, lastsynctimestamp, softdeleteflag) VALUES ('POLID2', 'Password Policy for End Customers', '<ul><li>Should contain 8-20 characters.</li>  <li>No spaces allowed.</li>  <li>Should be a combination of alpha-numeric (a-z, A-Z, 0-9) and special characters.</li>  <li>Special characters allowed: ! # $ % ( ) * @ + - _ [ ] ? / ^ ’ ; { } = ,</li>  <li>It should not be 9 consecutive digits</li>  <li>Should not be same as username.</li></ul>', 'Kony User', 'Kony Dev', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[policies](id, PolicyName, PolicyDescription, createdby, modifiedby, createdts, lastmodifiedts, lastsynctimestamp, softdeleteflag) VALUES ('POLID3', 'Username Policy for Internal Users', '8-15 characters<br>No special characters<br>Case sensitive<br>a-z, A-Z, 0-9<br> ', 'Kony User', 'Kony Dev', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[policies](id, PolicyName, PolicyDescription, createdby, modifiedby, createdts, lastmodifiedts, lastsynctimestamp, softdeleteflag) VALUES ('POLID4', 'Password Policy for Internal User', 'Combination of digits and alphabets<br>Space not allowed. All other special characters are allowed<br>You cannot choose your username as your password.<br> ', 'Kony User', 'Kony Dev', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[privacypolicy](id, Channel_id, Status_id, Description, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('PRIV_POL_ID1', null, 'SID_ACTIVE', ' <p style="text-align: justify;"><i><font face="Calibri" size="3" style="">At Kony Bank, the safeguarding of your account information is our top priority.&nbsp;</font><span style="font-family: Calibri; font-size: medium;">We strive to keep our members informed on current security issues, as well as providing the tools to help protect yourself. Please check back periodically to view new information as it becomes available.</span></i></p><p><b><font face="Calibri" size="3">Your account security</font></b></p><p><font face="Calibri" size="3">We protect your online <b>security</b>. Keeping financial and personal information about you secure and confidential is one of our most important responsibilities. Our systems are protected, so information remains secure.</font></p><p><span><span><font face="Calibri" size="3">1. </font></span></span><font face="Calibri" size="3">Computer virus protection detects and prevents computer viruses from entering our computer network systems.</font></p><p><span><span><font face="Calibri" size="3">2.</font><span> </span></span></span><font face="Calibri" size="3">Firewalls block unauthorized access by individuals or networks. Firewalls are just one way we protect our computer network systems that interact with the Internet.</font></p><p><span><span><font face="Calibri" size="3">3.</font><span> </span></span></span><font face="Calibri" size="3">Secure transmissions ensure information remains confidential. Kony Bank uses encryption technology such as Secure Socket Layer (SSL) on its Web sites to securely transmit information between you and the credit union.</font></p><p><span><span><font face="Calibri" size="3">4.</font><span> </span></span></span><font face="Calibri" size="3">Send secure e-mail to almost any department in the credit union through the Contact Us section. Because an Internet e-mail response back to you may not be secure, we will not include confidential account information in an e-mail response. In addition, you will never be asked for confidential information, such as passwords or PINs, through e-mail. Besides e-mail, you can contact us by phone or visiting any branch.</font></p><p><span><span><font face="Calibri" size="3">5.</font><span> </span></span></span><font face="Calibri" size="3">Regular evaluations of our security features and continuous research of new advances in security technology ensure that your personal information is protected.</font></p>', 'Kony User', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
INSERT INTO [konyadminconsole].[product](id, Type_id, ProductCode, Name, Status_id, ProductFeatures, ProductCharges, productDescription, AdditionalInformation, termsAndConditions, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('PRODUCT1', 'PRODUCT_TYPE1', '1', 'Club Savings Account', 'SID_PRO_ACTIVE', '<p>When you open a Savings Account, your initial $5.00 deposit initiates your membership benefits and makes you an owner, with annual voting privileges and access to favorable rates on loans and deposits. A Club Savings account is an additional savings account available to all existing members, and since it is not a membership account, there is no initial or minimum deposit amount. Many members use Club Savings to save for a special occasion, a holiday, or emergency expenses. </p>', '<ul><li>Minimum required deposit: None</li><li>Minimum monthly balance required: $5.00</li><li>Monthly service charges:None</li><li>Dividend pay: Compounded and paid monthly</li><li>Free online banking available: Yes</li></ul>', 'When you open a Savings Account, your initial $5.00 deposit initiates your membership benefits and makes you an owner, with annual voting privileges and access to favorable rates on loans and deposits. A Club Savings account is an additional savings account available to all existing members, and since it is not a membership account, there is no initial or minimum deposit amount. Many members use Club Savings to save for a special occasion, a holiday, or emergency expenses.', '<p>Federal regulations limit the number of transfers/withdrawals from a savings account to six per calendar month via fax, telephone, online, ACH, or overdraft. You may transfer/withdraw as often as you like in person, via mail or messenger, ATM, or to pay loan payments.</p><p>Fees could reduce earnings on accounts.</p>', '<p>This Agreement covers Kony New Account Opening &nbsp;services. "You" refers to the persons receiving the services provided under this Agreement. <strong>1. Enrolling in Online Banking</strong></p><ol><li>After you have reviewed this agreement, you can enroll in Online Banking by clicking on the "Accept" button. Please retain a copy of this Agreement for your records, either by printing a copy or saving a copy on your computer''s hard drive. Your clicking on the Accept button constitutes your consent to the terms of this Agreement and your acknowledgment that you have been able to retain a copy of this Agreement in paper or electronic form.</li><li>Bill Payer: Bill Payer requires an additional enrollment from within Online Banking.</li><li>Wire Transfers: Wire Transfers requires your acceptance of the Wire Transfer Agreement found at the Wire Transfer selection site. This service allows you to transfer funds via the Automated Clearinghouse (ACH) system from any of your accounts at any financial institution to any other account held by you or another person at the same or another financial institution.</li><li><strong> Account Review</strong> All enrollments in Online Banking, Bill Payer and External transfer Wire service are subject to Bank review and approval. Your accounts with the Bank must be in good standing. To use Bill Pay, you must have a Bank checking account. <strong>3. Other Governing Laws and Agreements</strong> Your use of Online Banking, Bill Payer or External Transfer Wire services to conduct transactions on your Bank accounts is also subject to the terms of your Bank Member Account Handbook, Master Membership Agreement and Schedule of Fees and Charges. Online Banking, Bill Payer and External Transfer Wire service are subject to applicable California and federal law, including but not limited to the Electronic Funds Transfer Act and Federal Reserve Regulation E. External transfer Wire service is also subject to the rules of the National Automated Clearing House Association (NACHA). If any provision of this Agreement is unenforceable, the remaining provisions will continue in effect. This Agreement will be given its reasonable meaning and not construed against either party. <strong>4. Required Equipment</strong> To use Online Banking, Bill Payer or External transfer Wire service, you will need the following: (a) Internet access; (b) a computer with modem and Internet browser that can support SSL and 128-bit encryption (Microsoft Internet Explorer 4.01 or later, Netscape Navigator/Communicator 4.51 or later, or AOL 3.0 or later, should support this level of encryption); and (c) access to a printer and/or other storage medium such as a hard drive for downloading information or printing disclosures. If these requirements change, we will notify you at least 21 days in advance. By clicking on the Accept button, you confirm that you have the equipment required to use Online Banking, Bill Payer and External transfer Wire service. <strong>5. Your Responsibility for Your Equipment</strong> You are solely responsible for installing, maintaining and operating your computer and your internet access. We will not be responsible for errors, deletions, failures, or damages of any kind that occur because of malfunctions of your computer, software or internet service. We will not be responsible for any virus that affects your computer or software while using our Online Banking, Bill Payer and or External Transfer Wire service. The warranties provided for Online Banking, Bill Payer and External Transfer WIREis limited to those expressly stated in this Agreement. <strong>6. Your Responsibility for Complying with This Agreement</strong> EWireowner of an account on which Online Banking and/or Bill Payer and/or External Transfer Wire service is established is responsible, jointly and individually, to meet the terms of this Agreement. These obligations continue until you notify us to terminate Online Banking and/or Bill Payer and/or External Transfer Wire service or we cancel your Online Banking, Bill Payer service or External Transfer Wire service for a reason permitted by law or this Agreement. EWireowner is responsible for all obligations incurred as a result of authorized use of Online Banking, Bill Payer or External Transfer Wire service until you or we terminate the service(s). Termination of Online Banking, Bill Payer or External Transfer Wire service will not relieve you of obligations incurred prior to termination. This obligation to the Bank will continue even if an owner is later relieved of the obligation by an agreement or court order to which we are not a party, such as a divorce decree. We are not subject to any agreement or court order to which we are not a party. No release from the obligations under this Agreement will be valid unless (a) in writing and signed by an authorized Bank employee or (b) pursuant to a court order in an action to which the Bank is a party. <strong>7. Security of Your Accounts</strong></li><li><strong>Your passcode:</strong>When you sign up for Online Banking, you will choose your own Access Identification Code (Access ID) and a Passcode. You will need both the Access ID and the Passcode to use the Service You are responsible for keeping your Access ID and Passcode secure. Refer to section 12 of this Agreement for information about your potential liability for unauthorized use of your accounts. Your Passcode is encrypted into our Online Banking database through Digital Insight. No person at Kony Bank or Digital Insight has access to your Passcode. No person at Kony Bank or Digital Insight is permitted to ask you for your Passcode. If any person requests your Passcode, please report the incident to us immediately. If you voluntarily give your Passcode to any person, you are authorizing that person to see any information and conduct any transaction on your accounts that you can see or conduct yourself. You are responsible for all transactions initiated by that person. That person''s authorization to see and use your accounts continues until you change your Passcode.</li><li><strong>Log-On Security:</strong>Your session will be automatically logged off if you have reached your current timeout period without activity. This is to reduce the risk of unauthorized use if you inadvertently leave your computer unattended with Online Banking open. When you return to your computer, you will be prompted to re-enter your Passcode, and your session will continue where you left off.</li><li><strong>Security Technology:</strong>(i) Online Banking uses Secure Socket Layer (SSL) encryption. The system will typically warn you if your Internet Browser does not have sufficient capacity to support our encryption system. If SSL is securing your communications with us, the appearance of a small padlock icon at the bottom of your screen should change to indicate this fact. (ii) The servers hosting Online Banking at Digital Insight have been certified by "Certificate Authority" to assure you that you are actually talking to Digital Insight instead of someone pretending to be Digital Insight. Depending on the age of your browser, you may see that "Certificate Authorities" have expired. If this happens, you must update it on your browser. Instructions for upgrading your browser are located in the Browser Update Link, which is located at the bottom of the Online Banking login page. (iii) Digital Insight will pass an encrypted cookie to your computer during your Online Banking sessions. These cookies do not collect any personal information about you. The cookies allow you to process several transactions without re-entering your Passcode for eWiretransaction. The cookie is destroyed when you log off of Online Banking, close your browser, or turn off your computer.</li><li><strong>Security Notices:</strong>In addition to the security features described above, there may be other security-related notices posted on our web site or Online Banking service from time to time. You are responsible for reading all security notices.</li><li><strong>No Security Warranty:</strong>Notwithstanding our efforts to ensure that Online Banking is secure, we cannot and do not warrant that either the Online Banking Home Banking system or data transmitted using the system will be free from monitoring or access by others.</li><li><strong> Privacy</strong> Please refer to the privacy statement on our website or to our printed privacy policy for full details of our policy on protecting your personal and financial information. With respect to your use of Online Banking, Bill Payer External transfer Wire service, we will disclose information about your accounts and the transfers you make to third parties (a) when necessary to complete transfers; (b) to verify the existence and condition of your account for a third party such as a credit bureau or merchant; (c) to comply with a governmental agency or court order; (d) if you give us written permission; (e) if necessary to fulfill agreements between us and our third party Online Banking, Bill Payer and External transfer Wire service providers; or (f) if it involves a claim by or against us in connection with a deposit to or withdrawal from your account.<br /> </li><li><strong> Termination</strong> We can discontinue any services we offer, including Online Banking, Bill Payer or External transfer Wire service. . We will notify you at least 21 days in advance if we do this. We can cancel your use of Online Banking, Bill Payer or External transfer Wire service without notice if you default on any term of any agreement you have with Kony Bank. If you close your Bank accounts, or if you have not used Online Banking for 6 consecutive months, Online Banking will be discontinued. You can ask to terminate Online Banking and/or Bill Payer and/or External transfer Wire service at any time by submitting a request by mail, in person, or by e-mail. Termination of your Online Banking, Bill Payer or External transfer Wire service will not relieve you of your liability with respect to any transactions processed before the service was terminated.<br /> </li><li><strong> Business Days</strong> Our business days are Monday through Friday, excluding federal holidays.<br /> </li><li><strong> Changes in Terms</strong> We can change the terms of this Agreement by giving you at least 21 days advance notice. A change in terms may include adding new terms, deleting existing terms, or changing existing terms. If you object to a change, you can avoid its application to your accounts by discontinuing the related service. If you have elected to receive Bank disclosures electronically, we will notify you by e-mail that the Change in Terms notice is available for you to pick up on our secure web site. Otherwise the change will be mailed to you. We can change terms without advance notice if (a) the change is not adverse to you, or (b) the change is necessary to maintain or restore the security of the Online Banking Home Banking system.<br /> </li><li><strong> Setoff, Attorney''s Fees and Collection Costs</strong> If your use of Online Banking, Bill Payer or External transfer Wire service results in your becoming indebted to us, and you do not pay what you owe upon our written demand, you agree that we can, unless prohibited by law or the account agreement, take funds in any Bank account in which you have an interest to recover all or part of what you owe without advance notice to you. Our exercising this right in the event of your default will not waive our right to use other lawful means to collect what you owe us. If we cannot recover what you owe from your other Bank accounts, you agree to pay reasonable collection costs we incur before we take legal action. If we take legal action to collect what you owe, you agree to pay our reasonable attorney''s fees and costs of suit in addition to any other remedy the court finds proper, whether the legal action is a collection lawsuit, a proceeding to protect our interests if you become a bankruptcy debtor, an action to enforce a judgment, an appeal, or another type of legal action.<br /> </li></ol><p>&nbsp;</p>', 'Kony User', 'Kony Dev', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
