ternet access; (b) a computer with modem and Internet browser that can support SSL and 128-bit encryption (Microsoft Internet Explorer 4.01 or later, Netscape Navigator/Communicator 4.51 or later, or AOL 3.0 or later, should support this level of encryption); and (c) access to a printer and/or other storage medium such as a hard drive for downloading information or printing disclosures. If these requirements change, we will notify you at least 21 days in advance. By clicking on the Accept button, you confirm that you have the equipment required to use Online Banking, Bill Payer and External transfer Wire service. <strong>5. Your Responsibility for Your Equipment</strong> You are solely responsible for installing, maintaining and operating your computer and your internet access. We will not be responsible for errors, deletions, failures, or damages of any kind that occur because of malfunctions of your computer, software or internet service. We will not be responsible for any virus that affects your computer or software while using our Online Banking, Bill Payer and or External Transfer Wire service. The warranties provided for Online Banking, Bill Payer and External Transfer WIREis limited to those expressly stated in this Agreement. <strong>6. Your Responsibility for Complying with This Agreement</strong> EWireowner of an account on which Online Banking and/or Bill Payer and/or External Transfer Wire service is established is responsible, jointly and individually, to meet the terms of this Agreement. These obligations continue until you notify us to terminate Online Banking and/or Bill Payer and/or External Transfer Wire service or we cancel your Online Banking, Bill Payer service or External Transfer Wire service for a reason permitted by law or this Agreement. EWireowner is responsible for all obligations incurred as a result of authorized use of Online Banking, Bill Payer or External Transfer Wire service until you or we terminate the service(s). Termination of 