 which we are not a party. No release from the obligations under this Agreement will be valid unless (a) in writing and signed by an authorized Bank employee or (b) pursuant to a court order in an action to which the Bank is a party. <strong>7. Security of Your Accounts</strong></li><li><strong>Your passcode:</strong>When you sign up for Online Banking, you will choose your own Access Identification Code (Access ID) and a Passcode. You will need both the Access ID and the Passcode to use the Service You are responsible for keeping your Access ID and Passcode secure. Refer to section 12 of this Agreement for information about your potential liability for unauthorized use of your accounts. Your Passcode is encrypted into our Online Banking database through Digital Insight. No person at Kony Bank or Digital Insight has access to your Passcode. No person at Kony Bank or Digital Insight is permitted to ask you for your Passcode. If any person requests your Passcode, please report the incident to us immediately. If you voluntarily give your Passcode to any person, you are authorizing that person to see any information and conduct any transaction on your accounts that you can see or conduct yourself. You are responsible for all transactions initiated by that person. That person''s authorization to see and use your accounts continues until you change your Passcode.</li><li><strong>Log-On Security:</strong>Your session will be automatically logged off if you have reached your current timeout period without activity. This is to reduce the risk of unauthorized use if you inadvertently leave your computer unattended with Online Banking open. When you return to your computer, you will be prompted to re-enter your Passcode, and your session will continue where you left off.</li><li><strong>Security Technology:</strong>(i) Online Banking uses Secure Socket Layer (SSL) encryption. The system will typically warn you if your Internet Browser does not have sufficient capacity to support our encryption system. If SSL is securing your communications with us, the appearance of a small padlock icon at the bottom of your screen should change to indicate this fact. (ii) The servers hosting Online Banking at Digital Insight have been certified by "Certificate Authority" to assure you that you are actually talking to Digital Insight instead of someone pretending to be Digital Insight. Depending on the age of your browser, you may see that "Certificate Authorities" have expired. If this happens, you must update it on your browser. Instructions for upgrading your browser are located in the Browser Update Link, which is located at the bottom of the Online Banking login page. (iii) Digital Insight will pass an encrypted cookie to your computer during your Online Banking sessions. These cookies do not collect any personal information about you. The cookies allow you to process several transactions without re-entering your Passcode for eWiretransaction. The cookie is destroyed when you log off of Online Banking, close your browser, or turn off your computer.</li><li><strong>Security Notices:</strong>In addition to the security features described above, there may be other security-related notices posted on our web site or Online Banking service from time to time. You are responsible for reading all security notices.</li><li><strong>No Security Warranty:</strong>Notwithstanding our efforts to ensure that Online Banking is secure, we cannot and do not warrant that either the Online Banking Home Banking system or data transmitted using the system will be free from monitoring or access by others.</li><li><strong> Privacy</strong> Please refer to the privacy statement on our website or to our printed privacy policy for full details of our policy on protecting your personal and financial information. With respect to your use of Online Banking, Bill Payer External transfer Wire service, we will disclose information about your accounts and the transfers you make to third parties (a) when necessary to complete transfers; (b) to verify the existence and condition of your account for a third party such as a credit bureau or merchant; (c) to comply with a governmental agency or court order; (d) if you give us written permission; (e) if necessary to fulfill agreements between us and our third party Online Banking, Bill Payer and External transfer Wire service providers; or (f) if it involves a claim by or against us in connection with a deposit to or withdrawal from your account.<br /> </li><li><strong> Termination</strong> We can discontinue any services we offer, including Online Banking, Bill Payer or External transfer Wire service. . We will notify you at least 21 days in advance if we do this. We can cancel your use of Online Banking, Bill Payer or External transfer Wire service without notice if you default on any term of any agreement you have with Kony Bank. If you close your Bank accounts, or if you have not used Online Banking for 6 consecutive months, Online Banking will be discontinued. You can ask to terminate Online Banking and/or Bill Payer and/or External transfer Wire service at any time by submitting a request by mail, in person, or by e-mail. Termination of your Online Banking, Bill Payer or External transfer Wire service will not relieve you of your liability with respect to any transactions processed before the service was terminated.<br /> </li><li><strong> Business Days</strong> Our business days are Monday through Friday, excluding federal holidays.<br /> </li><li><strong> Changes in Terms</strong> We can change the terms of this Agreement by giving you at least 21 days advance notice. A change in terms may include adding new terms, deleting existing terms, or changing existing terms. If you object to a change, you can avoid its application to your accounts by discontinuing the related service. If you have elected to receive Bank disclosures electronically, we will notify you by e-mail that the Change in Terms notice is available for you to pick up on our secure web site. Otherwise the change will be mailed to you. We can change terms without advance notice if (a) the change is not adverse to you, or (b) the change is necessary to maintain or restore the security of the Online Banking Home Banking system.<br /> </li><li><strong> Setoff, Attorney''s Fees and Collection Costs</strong> If your use of Online Banking, Bill Payer or External transfer Wire service results in your becoming indebted to us, and you do not pay what you owe upon our written demand, you agree that we can, unless prohibited by law or the account agreement, take funds in any Bank account in which you have an interest to recover all or part of what you owe without advance notice to you. Our exercising this right in the event of your default will not waive our right to use other lawful means to collect what you owe us. If we cannot recover what you owe from your other Bank accounts, you agree to pay reasonable collection costs we incur before we take legal action. If we take legal action to collect what you owe, you agree to pay our reasonable attorney''s fees and costs of suit in addition to any other remedy the court finds proper, whether the legal action is a collection lawsuit, a proceeding to protect our interests if you become a bankruptcy debtor, an action to enforce a judgment, an appeal, or another type of legal action.<br /> </li></ol><p>&nbsp;</p>', 'Kony User', 'Kony Dev', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 0);
