INSERT INTO [konyadminconsole].[termsandconditions](id, Service_id, Status_id, Description, createdby, modifiedby, createdts, lastmodifiedts, synctimestamp, softdeleteflag) VALUES ('TER_CON_ID1', null, 'SID_ACTIVE', '<p> This Agreement covers Kony Online Banking, Electronic Funds Transfers, Bill Payer and External Transfer services. "You" refers to the persons receiving the services provided under this Agreement.</p><p> <strong>1. Enrolling in Online Banking</strong></p><ol start="1" type="a"><li> After you have reviewed this agreement, you can enroll in Online Banking by clicking on the "Accept" button. Please retain a copy of this Agreement for your records, either by printing a copy or saving a copy on your computer''s hard drive. Your clicking on the Accept button constitutes your consent to the terms of this Agreement and your acknowledgment that you have been able to retain a copy of this Agreement in paper or electronic form.</li><li> Bill Payer: Bill Payer requires an additional enrollment from within Online Banking.</li><li> Wire Transfers: Wire Transfers requires your acceptance of the Wire Transfer Agreement found at the Wire Transfer selection site. This service allows you to transfer funds via the Automated Clearinghouse (ACH) system from any of your accounts at any financial institution to any other account held by you or another person at the same or another financial institution.</li></ol><p> <strong>2. Account Review</strong></p><p> All enrollments in Online Banking, Bill Payer and External transfer Wire service are subject to Bank review and approval. Your accounts with the Bank must be in good standing. To use Bill Pay, you must have a Bank checking account.</p><p> <strong>3. Other Governing Laws and Agreements</strong></p><p> Your use of Online Banking, Bill Payer or External Transfer Wire services to conduct transactions on your Bank accounts is also subject to the terms of your Bank Member Account Handbook, Master Membership Agreement and Schedule of Fees and Charges. Online Banking, Bill Payer and External Transfer Wire service are subject to applicable California and federal law, including but not limited to the Electronic Funds Transfer Act and Federal Reserve Regulation E. External transfer Wire service is also subject to the rules of the National Automated Clearing House Association (NACHA). If any provision of this Agreement is unenforceable, the remaining provisions will continue in effect. This Agreement will be given its reasonable meaning and not construed against either party.</p><p> <strong>4. Required Equipment</strong></p><p> To use Online Banking, Bill Payer or External transfer Wire service, you will need the following: (a) Internet access; (b) a computer with modem and Internet browser that can support SSL and 128-bit encryption (Microsoft Internet Explorer 4.01 or later, Netscape Navigator/Communicator 4.51 or later, or AOL 3.0 or later, should support this level of encryption); and (c) access to a printer and/or other storage medium such as a hard drive for downloading information or printing disclosures. If these requirements change, we will notify you at least 21 days in advance. By clicking on the Accept button, you confirm that you have the equipment required to use Online Banking, Bill Payer and External transfer Wire service.</p><p> <strong>5. Your Responsibility for Your Equipment</strong></p><p> You are solely responsible for installing, maintaining and operating your computer and your internet access. We will not be responsible for errors, deletions, failures, or damages of any kind that occur because of malfunctions of your computer, software or internet service. We will not be responsible for any virus that affects your computer or software while using our Online Banking, Bill Payer and or External Transfer Wire service. The warranties provided for Online Banking, Bill Payer and External Transfer WIREis limited to those expressly stated in this Agreement.</p><p> <strong>6. Your Responsibility for Complying with This Agreement</strong></p><p> EWireowner of an account on which Online Banking and/or Bill Payer and/or External Transfer Wire service is established is responsible, jointly and individually, to meet the terms of this Agreement. These obligations continue until you notify us to terminate Online Banking and/or Bill Payer and/or External Transfer Wire service or we cancel your Online Banking, Bill Payer service or External Transfer Wire service for a reason permitted by law or this Agreement. EWireowner is responsible for all obligations incurred as a result of authorized use of Online Banking, Bill Payer or External Transfer Wire service until you or we terminate the service(s). Termination of Online Banking, Bill Payer or External Transfer Wire service will not relieve you of obligations incurred prior to termination. This obligation to the Bank will continue even if an owner is later relieved of the obligation by an agreement or court order to which we are not a party, such as a divorce decree. We are not subject to any agreement or court order to which we are not a party. No release from the obligations under this Agreement will be valid unless (a) in writing and signed by an authorized Bank employee or (b) pursuant to a court order in an action to which the Bank is a party.</p><p> <strong>7. Security of Your Accounts</strong></p><ol start="1" type="a"><li> <strong>Your passcode:</strong> When you sign up for Online Banking, you will choose your own Access Identification Code (Access ID) and a Passcode. You will need both the Access ID and the Passcode to use the Service You are responsible for keeping your Access ID and Passcode secure. Refer to section 12 of this Agreement for information about your potential liability for unauthorized use of your accounts. Your Passcode is encrypted into our Online Banking database through Digital Insight. No person at Kony Bank or Digital Insight has access to your Passcode. No person at Kony Bank or Digital Insight is permitted to ask you for your Passcode. If any person requests your Passcode, please report the incident to us immediately. If you voluntarily give your Passcode to any person, you are authorizing that person to see any information and conduct any transaction on your accounts that you can see or conduct yourself. You are responsible for all transactions initiated by that person. That person''s authorization to see and use your accounts continues until you change your Passcode.</li><li> <strong>Log-On Security:</strong> Your session will be automatically logged off if you have reached your current timeout period without activity. This is to reduce the risk of unauthorized use if you inadvertently leave your computer unattended with Online Banking open. When you return to your computer, you will be prompted to re-enter your Passcode, and your session will continue where you left off.</li><li> <strong>Security Technology:</strong> (i) Online Banking uses Secure Socket Layer (SSL) encryption. The system will typically warn you if your Internet Browser does not have sufficient capacity to support our encryption system. If SSL is securing your communications with us, the appearance of a small padlock icon at the bottom of your screen should change to indicate this fact. (ii) The servers hosting Online Banking at Digital Insight have been certified by "Certificate Authority" to assure you that you are actually talking to Digital Insight instead of someone pretending to be Digital Insight. Depending on the age of your browser, you may see that "Certificate Authorities" have expired. If this happens, you must update it on your browser. Instructions for upgrading your browser are located in the Browser Update Link, which is located at the bottom of the Online Banking login page. (iii) Digital Insight will pass an encrypted cookie to your computer during your Online Banking sessions. These cookies do not collect any personal information about you. The cookies allow you to process several transactions without re-entering your Passcode for eWiretransaction. The cookie is destroyed when you log off of Online Banking, close your browser, or turn off your computer.</li><li> <strong>Security Notices:</strong> In addition to the security features described above, there may be other security-related notices posted on our web site or Online Banking service from time to time. You are responsible for reading all security notices.</li><li> <strong>No Security Warranty:</strong> Notwithstanding our efforts to ensure that Online Banking is secure, we cannot and do not warrant that either the Online Banking Home Banking system or data transmitted using the system will be free from monitoring or access by others.</li></ol><p> <strong>8. Available Services</strong></p><p> If you enroll in Online Banking online, you will have completed your enrollment and may start using the service immediately.</p><p> Online Banking, Bill Payer and External transfer Wire service are generally available 24 hours a day, 7 days a week. The system may be temporarily unavailable from time to time for maintenance, due to high Internet traffic volume, or for other reasons beyond our control. If this happens, please try your transaction again later. We are not responsible for any delays you have in accessing or using Online Banking, Bill Payer or External transfer Wire service.</p><ol start="1" type="a"><li> <strong>You can use Online Banking to:</strong></li></ol><ol start="1" type="a"></ol><ul type="disc"><li> Review up to 6 months of transaction history</li><li> Review account balances and available balances</li><li> Review account transactions</li><li> Review interest earned on accounts and interest paid on loans</li><li> Send secure e-mails</li><li> Transfer funds to pay Bank loans</li><li> Transfer funds between Bank accounts</li><li> Advance funds from your Bank Line of Credit</li><li> Download account data to current versions of Quicken</li><li> Pay bills using your Bank checking account with the Bill Payer Service</li><li> Access eStatements</li><li> Change your email address</li><li> Reorder checks</li><li> View images of cleared checks</li><li> Stop payment on checks you have written</li><li> Change online timeout period</li><li> Change your Online Banking passcode</li><li> Change you Access I.D.</li><li> Change history date range and default sort order</li><li> Change your start page</li><li> Execute external transfers</li><li> Utilize Secure Chat</li><li> Complete cross account transfers</li></ul><p> <strong>9. Limitations</strong></p><ol start="1" type="a"><li> <strong>Limits on Non-Personal Transfers and Withdrawals</strong></li></ol><p> As required by Federal Reserve Regulation D, you are limited to six non-personal transfers or withdrawals out of your non-transaction accounts per month. Only checking/share draft accounts are considered transaction accounts. Non-personal transfers include transfers made via Online Banking, Bill Payer, audio response, ACH, and overdraft protection transfers. The following types of transactions do not count toward the six-per-month limit on withdrawals and transfers out of non-transaction accounts: (a) transactions made in person; (b) transactions made by messenger; (c) transactions at ATMs; (d) withdrawals in the form of a check mailed to you at your address in your records. All Bill Payer payments must be made from a Bank checking/share draft account.</p><ol start="2" type="a"><li> <strong>Account Balance Information</strong></li></ol><p> Balances displayed on Online Banking may include deposits that we have not yet verified and therefore are not actually available for withdrawal. Online Banking balances may also differ from your records due to deposits in progress, checks outstanding, or other circumstances. When a transaction is presented to us via Online Banking, we will use the available balance in your account to determine whether to authorize the transaction. Our completion of a transaction does not necessarily mean that there are sufficient funds to pay all items that have not cleared your account.</p><p> <strong>10. Fees</strong></p><p> Online Banking is free. The same fees that apply to account transactions conducted by other means will apply to transactions initiated using Online Banking or Bill Payer. For example, if a Bill Payer transaction is returned unpaid due to insufficient funds, you will pay our standard checking/share draft NSF fee with a max per day per account of six. Fees are subject to change. Please refer to the current Bank Schedule of Fees and Charges for fees and fee waiver qualifications.</p><p> <strong>11. Our Liability for Failure to Cancel or Stop Payments</strong></p><p> If you attempt to cancel a payment or transfer and we do not do so even though we have sufficient time to act on your request, we will be liable for your losses or damages. In no event will we be liable for damages in excess of the actual loss caused by our failure to cancel the payment, and we will not be liable for any incidental, special or consequential damages.</p><p> <strong> 12. Your Liability for Unauthorized Use of Online Banking, Bill Payer and External transfer Wire service </strong></p><p> Tell us AT ONCE if you believe your Access ID or Passcode has been lost, stolen or compromised. Telephoning is the best way to keep your possible losses down. Call us at the number or write to us at the address below under "How to Contact Us." in Section 23. You could lose all of the money in your accounts (plus your maximum overdraft line of credit) if you do not tell us on time.</p><ol start="1" type="a"><li> If you believe your Passcode has been compromised, lost or stolen, and you tell us within two business days after you learn of the loss or theft, you can lose no more than $50 if someone used your Passcode without your permission.</li><li> If you do NOT tell us within two business days after you learn of the loss or theft of your Passcode, and we can prove we could have stopped someone from using your Passcode without your permission if you had told us sooner, you could lose as much as $500.</li><li> If your statement shows transfers or payments that you did not make, tell us at once. If you do not tell us within 60 days after we sent you the first statement on which the unauthorized transfer or payment appeared, you may not get back any money you lost after the 60-day period if we can prove that we could have stopped someone from taking the money if you had told us on time.</li><li> If a good reason (such as a long trip or hospital stay) prevented you from telling us, we may extend the time periods.</li><li> Remember that if you give someone your Access ID and Passcode, you are authorizing them to use Online Banking, Bill Payer and External transfer Wire service and you are responsible for all transactions they perform until you tell us to change or cancel your Access ID and Passcode. This is true even if the person exceeds the scope of permission you gave them to use your accounts. We are not subject to agreements that you make with other people limiting their use of your accounts.</li><li> You are not liable for fraudulent transfers initiated by our employees or by employees of Digital Insight.</li></ol><p> <strong>13. Privacy</strong></p><p> Please refer to the privacy statement on our website or to our printed privacy policy for full details of our policy on protecting your personal and financial information. With respect to your use of Online Banking, Bill Payer External transfer Wire service, we will disclose information about your accounts and the transfers you make to third parties (a) when necessary to complete transfers; (b) to verify the existence and condition of your account for a third party such as a credit bureau or merchant; (c) to comply with a governmental agency or court order; (d) if you give us written permission; (e) if necessary to fulfill agreements between us and our third party Online Banking, Bill Payer and External transfer Wire service providers; or (f) if it involves a claim by or against us in connection with a deposit to or withdrawal from your account.</p><p> <strong> 14. Our Liability for Failure to Complete Your Transactions </strong></p><p> If we do not complete a transaction to or from your accounts on time or in the correct amount according to our agreement with you, we will be liable for your losses or damages. However, there are some exceptions. We will not be liable if:</p><ol start="1" type="a"><li> Through no fault of ours, you do not have available funds or overdraft protection to complete the transaction;</li><li> Your account is closed;</li><li> The Online Banking system was not working properly and you knew or should have know about the problem when you started your transaction;</li><li> The transaction failure or error resulted from a problem with your hardware, software, Internet service provider or other equipment or services over which we have no control;</li><li> Circumstances beyond our control (such as fire, flood, telephone disruption, computer breakdown or postal service disruption) prevent completion of the transaction despite our having taken reasonable precautions;</li><li> Your Access ID or Passcode have been reported lost or stolen and we have blocked their use;</li><li> You failed to supply complete and accurate information required to complete your transaction;</li><li> You failed to allow sufficient time for a Bill Payment to reWirethe payee;</li><li> We deliver a Bill Payment to the payee on time but the payee fails to post the payment in a timely manner;</li><li> Your account is blocked by a legal proceeding such as a garnishment or a court-ordered block that prevents us from making the payment;</li><li> We establish other lawful exceptions and give you proper advance notice of them.</li></ol><p> In no event will be liable for damages in excess of your actual damages, limited to the amount of the payment plus any late fee up to $50. (See the Payment Guarantee below.) We will not be liable for incidental, special, consequential or punitive damages.</p><p> We are not responsible for delays in posting by payees as long as the payee receives payment from us in a timely manner. We are not responsible for losses or damages resulting from your failure to provide us with correct information about your payments or payees. We are not responsible for checks lost by the U.S. postal service or for other untimely payments that result from circumstances outside our control.</p><p> <strong>15. Payment Guarantee</strong></p><p> Due to circumstances beyond the control of the Bank and our service providers for Online Banking, Bill Payer and External transfer Wire services, particularly delays in handling and posting payments by Billers or financial institutions, some transactions may take longer to be credited to your account. We will bear responsibility for any late payment related charges up to $50.00 should a payment post after its Due Date as long as the payment was scheduled in accordance with the guidelines described under "Payment Scheduling" in this Agreement.</p><p> <strong>16. Our Responsibility to Follow Your Instructions</strong></p><p> The Bank and Digital Insight will carry out instructions we receive using your Access ID and Passcode in a reasonable manner. You agree to defend, indemnify and hold the Bank, Digital Insight and any of our officers, directors, agents, employees, consultants, or contractors harmless from all costs, claims, damages, expenses and liability we sustain as a result of carrying out, in a reasonable manner, instructions that we receive from you or authorized users of your Online Banking and/or Bill Payer External transfer Wire services.</p><p> <strong>17. Your Right to Receive Documentation of Transactions</strong></p><p> You can review your Online Banking, Bill Payer and External transfer Wire service transactions at any time using Online Banking. Online Banking and Bill Payer transactions will appear on your periodic account statements. Please use the Online Banking "Help" menu if you have difficulty with information being cut off when you print out account history data..</p><p> <strong>18. Termination</strong></p><p> We can discontinue any services we offer, including Online Banking, Bill Payer or External transfer Wire service. . We will notify you at least 21 days in advance if we do this. We can cancel your use of Online Banking, Bill Payer or External transfer Wire service without notice if you default on any term of any agreement you have with Kony Bank. If you close your Bank accounts, or if you have not used Online Banking for 6 consecutive months, Online Banking will be discontinued. You can ask to terminate Online Banking and/or Bill Payer and/or External transfer Wire service at any time by submitting a request by mail, in person, or by e-mail. Termination of your Online Banking, Bill Payer or External transfer Wire service will not relieve you of your liability with respect to any transactions processed before the service was terminated.</p><p> <strong>19. Business Days</strong></p><p> Our business days are Monday through Friday, excluding federal holidays.</p><p> <strong>20. Changes in Terms</strong></p><p> We can change the terms of this Agreement by giving you at least 21 days advance notice. A change in terms may include adding new terms, deleting existing terms, or changing existing terms. If you object to a change, you can avoid its application to your accounts by discontinuing the related service. If you have elected to receive Bank disclosures electronically, we will notify you by e-mail that the Change in Terms notice is available for you to pick up on our secure web site. Otherwise the change will be mailed to you. We can change terms without advance notice if (a) the change is not adverse to you, or (b) the change is necessary to maintain or restore the security of the Online Banking Home Banking system.</p><p> <strong>21. Setoff, Attorney''s Fees and Collection Costs</strong></p><p> If your use of Online Banking, Bill Payer or External transfer Wire service results in your becoming indebted to us, and you do not pay what you owe upon our written demand, you agree that we can, unless prohibited by law or the account agreement, take funds in any Bank account in which you have an interest to recover all or part of what you owe without advance notice to you. Our exercising this right in the event of your default will not waive our right to use other lawful means to collect what you owe us. If we cannot recover what you owe from your other Bank accounts, you agree to pay reasonable collection costs we incur before we take legal action. If we take legal action to collect what you owe, you agree to pay our reasonable attorney''s fees and costs of suit in addition to any other remedy the court finds proper, whether the legal action is a collection lawsuit, a proceeding to protect our interests if you become a bankruptcy debtor, an action to enforce a judgment, an appeal, or another type of legal action.</p><p> <strong> 22. In Case of Errors or Questions Regarding Electronic Funds Transfers </strong></p><p> If you believe that an unauthorized electronic funds transfer occurred on your account or that any other type of error occurred on an electronic funds transfer, please contact us as indicated under "How to Contact Us" below.</p><p> Contact us as soon as you can if you think your account history is wrong, or if you need more information concerning an EFT transaction on your account history. We must hear from you not later than 60 days after we sent you the FIRST statement on which the error or problem appeared.</p><p> Please give us the following information about Online Banking transactions:</p><ul type="disc"><li> Your name</li><li> Your account number</li><li> Your Access ID (but not your Passcode)</li><li> A description of the error or the transaction you are not sure about, and as clear an explanation as you can provide of why you believe there is an error or why you need more information</li><li> The dollar amount of the suspected error</li></ul><p> For Bill Payer transactions, we will need the following information:</p><ul type="disc"><li> The account number used to pay the bill</li><li> The name of the payee</li><li> The date the payment was scheduled</li><li> The payment confirmation number</li><li> The payment amount</li><li> The payee account number for the payment in question.</li></ul><p> If you tell us orally, we may require you to send your complaint or question in writing within 10 business days.</p><p> We will determine whether an error occurred within 10 business days after we hear from you and will correct any error promptly. If we need more time, however, we may take up to 45 days to investigate your complaint or question (90 days if you have had accounts with us for less than 30 days or if your transaction was initiated outside the United States). If we decide to take more time, we will provisionally credit your account within 10 business days (20 days if you have had accounts with us for less than 30 days) for the amount you think is in error, so you will have use of the money while we investigate. If you do not put your complaint or question in writing within 10 days after we ask you to do so, we may not provisionally credit your account while we are investigating.</p><p> We will tell you the results within three business days after we complete our investigation. If we decide there was no error, we will send you a written explanation. You can request copies of the documents we used in our investigation. If there was no error, we will reverse any credits to your account and notify you that we have done so. We will pay any amounts by which your accounts are overdrawn for five business days after we reverse the provisional credit and we will not charge any overdraft fees, but only to the extent the overdraft does not exceed the amount of the provisional credit. If any overdraft exceeds the amount of the reversed provisional credit, we are not obligated to pay it unless you have overdraft protection available, and we are entitled to collect overdraft fees. In any event, you are obligated to restore any amounts by which your accounts are in negative balance.</p><p> <strong>23. How to Contact Us</strong></p><p> You can</p><ul type="disc"><li> Write to us at Kony Bank, P.O. Box 18460 , San Jose, CA 95158-8460</li><li> Telephone us at (408) 445-3386 or (800) 232-8669. Telephone assistance is available 6:00 a.m. to 6:00 p.m. (Pacific Time) Monday through Thursday and 6:00 a.m. to 7:00 p.m. (Pacific Time) on Friday.</li><li> Use the "Request Payment Inquiry" link in the Payments section of Online Banking</li><li> Visit any Bank Office.</li></ul><p> <strong>24. Additional Terms</strong></p><ul type="disc"><li> You authorize Kony Bank and Digital Insight to copy, use, modify, display and distribute any information, data, materials or other content as necessary to provide the services you request that are described in this Agreement and Disclosure.</li><li> You grant Kony Bank and Digital Insight a license to access the web sites and databases of other financial institutions where you hold accounts, as designated by you, to retrieve information and implement fund transfers and other transactions that you request under this Agreement and Disclosure</li><li> You represent and warrant that you have the right to authorize Kony Bank and Digital Insight to access your accounts to implement fund transfers and other transactions you request under this Agreement and Disclosure.</li><li> You represent that by disclosing and authorizing Kony Bank and Digital Insight to use such information, you are not violating any third party''s rights.</li><li> You warrant and represent that all information you provide to Kony Bank and Digital Insight is true, current, accurate, and complete.</li><li> You appoint Kony Bank and Digital Insight as your true and lawful attorney-in-fact and agent, with full power of substitution and re-substitution, for you and in your name, place and stead, in any and all capacities, to access accounts to affect fund transfers and other transactions described in this Agreement and Disclosures and requested by you, with full power and authority to do so and to perform eWireand every act and thing necessary to be done in connection with implementing requested transactions, including verifying the content and authenticity of fund transfer and other transaction instructions for purposes of security procedures applicable to accounts, as fully to all intents and purposes as you might or could in person.</li><li> You authorize us to select any reasonable and lawful means to implement your transaction instructions.</li><li> You represent and warrant that you are at least 18 years of age, you have read this Agreement and Disclosure, and you agree to be bound by its terms and conditions. You agree that we can and will rely on your warranties, representations, covenants and agreements in this Agreement and Disclosure.</li></ul><p> ONLINE BANKING, BILL PAYER AND EXTERNAL TRANSFER WIRE SERVICE AND RELATED DOCUMENTATION ARE PROVIDED "AS IS" WITHOUT WARRANTY OF ANY KIND, EITHER EXPRESSED OR IMPLIED, INCLUDING, BUT NOT LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE.</p><p> <strong>Proceed with enrollment for The Service.</strong> By clicking on the "<strong>Accept</strong>" button you are acknowledging that you have read and agree to the terms and conditions of this Agreement and would like to proceed with online registration.</p><p> (If you do not agree, choose cancel below.)</p><p> If you click "<strong>cancel</strong>" you can still enroll in our Online Banking at a later time by completing an application in one of our offices or by mailing us the enrollment application. You will still be required to accept the Terms of this Agreement.</p><p> <strong> FinanceWorks &amp; Debit Rewards Offers -- End User License Agreement </strong></p><p> <strong> In addition to the above content, if you decide to use either FinanceWorks or the Debit Rewards Offers application, you acknowledge and agree to the following terms and conditions of service. </strong></p><p> <strong>LICENSE GRANT AND RESTRICTIONS. </strong> You are granted a personal, limited, non-exclusive, non-transferable license, to electronically access and use the FinanceWorks Service (the "Service") solely to manage your financial data, and the purchase rewards application ("Debit Rewards Offers") to benefit from your debit card purchases.</p><p> In addition to the FinanceWorks Service and the Debit Rewards Offers, the terms "Service" and "Debit Rewards Offers" also include any other programs, tools, internet-based services, components and any "updates" (for example, Service maintenance, Debit Rewards information, help content, bug fixes, or maintenance releases, etc.) of the Service or Debit Rewards Offers if and when they are made available to you by us or by our third party vendors. Certain Service and Debit Rewards Offers may be accompanied by, and will be subject to, additional terms and conditions.</p><p> You are not licensed or permitted to do any of the following and you may not allow any third party to do any of the following: (i) access or attempt to access any other systems, programs or data that are not made available for public use; (ii) copy, reproduce, republish, upload, post, transmit, resell or distribute in any way the material from the FinanceWorks site or from the Debit Rewards Offers program; (iii) permit any third party to benefit from the use or functionality of the Service or Debit Rewards Offers, or any other services provided in connection with them, via a rental, lease, timesharing, service bureau, or other arrangement; (iv) transfer any of the rights granted to you under this license; (v) work around any technical limitations in the Service, use any tool to enable features or functionalities that are otherwise disabled in the Service, or decompile, disassemble, or otherwise reverse engineer the Service except as otherwise permitted by applicable law; (vi) perform or attempt to perform any actions that would interfere with the proper working of the Service or Debit Rewards Offers or any services provided in connection with them, prevent access to or the use of the Service, Debit Rewards Offers or any or services provided in connection with them by other licensees or customers, or impose an unreasonable or disproportionately large load on the infrastructure while using the Service; or (vii) otherwise use the Service, Debit Rewards Offers or any services provided in connection with them except as expressly allowed under this Section 1.</p><p> <strong>OWNERSHIP. </strong> The Service and Debit Rewards Offers are protected by copyright, trade secret and other intellectual property laws. You do not have any rights to the trademarks or service marks.</p><p> <strong>YOUR INFORMATION AND ACCOUNT DATA WITH US. </strong> You are responsible for (i) maintaining the confidentiality and security of your access number(s), password(s), security question(s) and answer(s), account number(s), login information, and any other security or access information, used by you to access the Service, Debit Rewards Offers or any services provided in connection with them, and your accounts with us (collectively, "Licensee Access Information"), and (ii) preventing unauthorized access to or use of the information, files or data that you store or use in or with the Service, Debit Rewards Offers or any services provided in connection with them (collectively, "Account Data"). You are responsible for providing access and assigning passwords to other users, if any, under your account for the Service, Debit Rewards Offers or any services provided in connection with them, and ensuring that such authorized users comply with this Agreement. You will be responsible for all electronic communications, including account registration and other account holder information, email and financial, accounting and other data ("Communications") entered using the Licensee Access Information. It is assumed that any Communications received through use of the Licensee Access Information were sent or authorized by you. You agree to immediately notify us if you become aware of any loss, theft or unauthorized use of any Licensee Access Information. We reserve the right to deny you access to the Service, Debit Rewards Offers or any services provided in connection with them (or any part thereof) if we reasonably believe that any loss, theft or unauthorized use of Licensee Access Information has occurred. You must inform us of, and hereby grant to us and our third party vendors permission to use, Licensee Access Information to enable us to provide the Service, Debit Rewards Offers or any services provided in connection with them to you, including updating and maintaining Account Data, addressing errors or service interruptions, and to enhance the types of data and services we may provide to you in the future.</p><p> We may use anonymous, aggregate information, which we collect and store, or which is collected and stored on our behalf by third party vendors, to conduct certain analytical research and help us to create new offerings and services for our customers. As we make additional offerings and online banking services available to you, some of which may rely on banking information maintained in your accounts, you will have the opportunity to participate in the services if you choose. If you choose not to participate, you do not need to notify us. We may also use anonymous, aggregate information which we collect and store, or which is collected and stored on our behalf by third party vendors, to (i) conduct database marketing and marketing program execution activities; (ii) publish summary or aggregate results relating to metrics comprised of research data from time to time; and (iii) distribute or license such aggregated research data to third parties. Additionally, automated technology may be used to tailor messages or advertisements that best reflect your interest and needs.</p><p> <strong> YOUR INFORMATION AND ACCOUNT DATA WITH OTHER FINANCIAL INSTITUTIONS. </strong> Our financial management tools allow you to view accounts that you may have outside our financial institution (this is a process called "aggregation"). When you choose to use online financial services which are applicable to data that you have transacted with other financial institutions or card issuers, you are consenting to us accessing and aggregating your data from those outside financial institutions. That data includes your financial institution account access number(s), password(s), security question(s) and answer(s), account number(s), login information, and any other security or access information used to access your account(s) with other financial institutions, and the actual data in your account(s) with such financial institution(s) such as account balances, debits and deposits (collectively, "Financial Account Data"). In giving that consent, you are agreeing that we, or a third party vendor on our behalf, may use, copy and retain all non-personally identifiable information of yours for the following purposes: (i) as pertains to the use, function, or performance of the services which you have selected; (ii) as necessary or useful in helping us, or third parties on our behalf, to diagnose or correct errors, problems, or defects in the services you have selected; (iii) for measuring downloads, acceptance, or use of the services you have selected; (iv) for the security or protection of the services you have selected; (v) for the evaluation, introduction, implementation, or testing of the services you have selected, or their upgrade, improvement or enhancement; (vi) to assist us in performing our obligations to you in providing the services you have selected.</p><p> If we make additional online financial services available to you which are applicable to data that you have transacted with other financial institutions or card issuers, and which we will aggregate at this site, we will separately ask for your consent to collect and use that information to provide you with relevant offers and services. If you give us your consent, you will be agreeing to permit us to use Financial Account Data to help us suggest savings opportunities or additional products and services to you.</p><p> If you select services that are offered by third parties or merchants through such offers or on our behalf, you will be agreeing that we have your consent to give such third parties or merchants your geographic location, and other data, collected and stored in aggregate, as necessary for such third parties or merchants to make their offerings and services available to you and to permit us to use Financial Account Data to help us suggest savings opportunities or additional products and services to you. Except as specified here, we and the third parties or merchants acting on our behalf shall not use or keep any of your personally identifiable information.</p><p> <strong>USE, STORAGE AND ACCESS. </strong> We shall have the right, in our sole discretion and with reasonable notice posted on the FinanceWorks site and/or sent to your email address provided in the Registration Data, to establish or change limits concerning use of the Service and any related services, temporarily or permanently, including but not limited to (i) the amount of storage space you have available through the Service at any time, and (ii) the number of times (and the maximum duration for which) you may access the Service in a given period of time. We reserve the right to make any such changes effective immediately to maintain the security of the system or Licensee Access Information or to comply with any laws or regulations, and to provide you with electronic or written notice within thirty (30) days after such change. You may reject changes by discontinuing use of the Service and any related services to which such changes relate. Your continued use of the Service or any related services will constitute your acceptance of and agreement to such changes. Maintenance of the Service or any related services may be performed from time-to-time resulting in interrupted service, delays or errors in such Service or related services. Attempts to provide prior notice of scheduled maintenance will be made, but we cannot guarantee that such notice will be provided.</p><p> <strong>THIRD PARTY SERVICES. </strong> In connection with your use of the Service, Debit Rewards Offers, or any other services provided in connection with them, you may be made aware of services, products, offers and promotions provided by third parties, ("Third Party Services"). If you decide to use Third Party Services, you are responsible for reviewing and understanding the terms and conditions governing any Third Party Services. You agree that the third party is responsible for the performance of the Third Party Services.</p><p> <strong>THIRD PARTY WEBSITES. </strong> The Service may contain or reference links to websites operated by third parties ("Third Party Websites"). These links are provided as a convenience only. Such Third Party Websites are not under our control. We are not responsible for the content of any Third Party Website or any link contained in a Third Party Website. We do not review, approve, monitor, endorse, warrant, or make any representations with respect to Third Party Websites, and the inclusion of any link in the Service, Debit Rewards Offers or any other services provided in connection with them is not and does not imply an affiliation, sponsorship, endorsement, approval, investigation, verification or monitoring by us of any information contained in any Third Party Website. In no event will we be responsible for the information contained in such Third Party Website or for your use of or inability to use such website. Access to any Third Party Website is at your own risk, and you acknowledge and understand that linked Third Party Websites may contain terms and privacy policies that are different from ours. We are not responsible for such provisions, and expressly disclaim any liability for them.</p><p> <strong>EXPORT RESTRICTIONS. </strong> You acknowledge that the Service may contain or use software that is subject to the U.S. Export Administration Regulations (15 CFR, Chapter VII) and that you will comply with these regulations. You will not export or re-export the Service, directly or indirectly, to: (1) any countries that are subject to US export restrictions; (2) any end user who has been prohibited from participating in US export transactions by any federal agency of the US government; or (3) any end user who you know or have reason to know will utilize them in the design, development or production of nuclear, chemical or biological weapons. You further acknowledge that this product may include technical data subject to export and re-export restrictions imposed by US law.</p><p> <strong>DEBIT REWARDS OFFERS. </strong> If you decide you wish to participate in the Debit Rewards Offers application, you acknowledge and agree to the following terms and conditions of service.</p><p> <u>Debit Rewards</u> . You will earn rewards for your participation in the Debit Rewards Offers program based on total purchases. If you participate in the Debit Rewards Offers, we will credit all cash or point rewards earned to your rewards balance and send you a lump sum of all rewards due to you. For any qualifying purchases during the current month, we will distribute the lump sum amount to you during the following calendar month. For example, if the payment date of all rewards end user disbursements is August 30, the applicable Measurement Period would be the calendar month ended July 31. Cash rewards will be deposited in the Debit Rewards Offers deposit account which is associated with the Debit Rewards Offers program.</p><p> <u>Debit Rewards Offers Account</u> . You must use the debit card associated with the Debit Rewards Offers account in order to receive the offers which qualify for the rewards. Rewards will not be earned for any portion of your purchase that you pay for with store credit, gift certificates or other payment types.</p><p> Purchases must be made as indicated in the offers made available under the Debit Rewards Offers program. EWireoffer will specify whether the purchase can be made online, at a store location, or by telephone to be eligible for rewards. You must also comply with any guidelines included with the offer, such as offer expiration dates, minimum purchase amounts, purchase limits, etc. You must also pay using the debit card associated with the account that received the Debit Rewards offer in order for the purchase to qualify.</p><p> While we and the merchants work hard to properly track and credit all eligible purchases, there may be times that we are unable to do so because of problems with your internet browser, the merchant''s web site or our system. Please contact our support team if you believe you have made a qualifying purchase for which you did not receive Rewards.</p><p> Please note that you will not earn rewards as part of this program if you use a debit card not issued by us or do not have the designated deposit account opened with us at the time of disbursement.</p><p> You understand and agree that we make no warranties and have no liability as to:</p><p>Any offers, commitments, promotions, money back, or other incentives offered by any of the merchants in the Debit Rewards Offers program.</p><p>&nbsp;The rewards information that we provide to you, which is provided "as is" and "as available".</p><p>&nbsp;(i) your inability to comply with offer guidelines, (ii) the accuracy, timeliness, loss or corruption, or mis-delivery, of any qualifying purchase information or any other information, (iii) unauthorized access to your account(s) or to your account information and any misappropriation, or alteration, of your account information or data, to the extent that the unauthorized access results from your acts or omissions, or (iv) your inability to access your account(s) including, but not limited to, failure of electronic or mechanical equipment, interconnect problems with telephone providers or internet service providers, acts of God, strikes, or other labor problems.</p><p>Some states do not allow limitations on how long an implied warranty lasts, so that the above limitations may not apply to you, and that you may also have other rights, which vary from state to state.</p>', 'Kony User', 'UID11', CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, '0');
